const About = () => {
	return (
		<div>
            <header className="App-header">
                <h5>
                Edit your life and save to reload.
                </h5>
                <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
                >
                About me
                </a>
            </header>
        </div>
	);
};

export default About;
